} Note that it is possible to compose source filters, especially if filterCargoSources omits files which are relevant to the build. For example: let # Only keeps markdown files markdownFilter = path: _type: builtins.match ".*md$" path != null; markdownOrCargo = path: type: (markdownFilter path type) || (craneLib.filterCargoSources path type);
in
cleanSourceWith { src = craneLib.path ./.; filter = markdownOrCargo;
}

