mkDummySrc :: set -> drv Converts a given source directory of a cargo workspace to the smallest, most trivial form needed to build all dependencies such that their artifacts can be cached. The actual source files of the project itself are ignored/replaced with empty programs, such that changes to the source files does not invalidate any build caches. More specifically: The Cargo.lock file is kept as-is Any changes to it will invalidate the build cache Any cargo configuration files (i.e. files name config or config.toml whose parent directory is named .cargo) are kept as-is. Any changes to these files will invalidate the build cache Any files named Cargo.toml are reduced via cleanCargoToml and the result is kept. Only the following changes will result in invalidating the build cache: Any changes to listed dependencies Any changes to feature definitions Any changes to the workspace member metadata Any changes to the [package] definition such as name and version Any changes to the name or path of any target (such as benches, bins, examples, libs, or tests) Required attributes src: a source directory which should be turned into a "dummy" form Optional attributes cargoLock: a path to a Cargo.lock file Default value: src + /Cargo.lock dummyrs: a path to a file which will be used in place of all dummy rust files (e.g. main.rs, lib.rs, etc.). This can be useful to customize dummy source files (e.g. enable certain lang features for a given target). Default value: an empty fn main declaration and conditionally enabled #![no_std] if the target_os cfg is set to "none" or "uefi". extraDummyScript: additional shell script which will be run inside the builder verbatim. Useful for customizing what the dummy sources include by running any arbitrary commands. Default value: "" Note that this script will run in an environment where the original source is not present as doing so would cause a rebuild if any part of the source changed. Additional files can be copied to the derivation's result, but care must be taken that the derivation only depends on (i.e. is rebuilt if) the smallest subset of the original source as required. Here is an example of how to include an entire directory, in this case .cargo, but any other directory would work as well: let
in
mkDummySrc { # The _entire_ source of the project. mkDummySrc will automatically # filter out irrelevant files as described above src = craneLib.path ./.; # Note that here we scope the path to just `./.cargo` and not any other # directories which may exist at the root of the project. Also note that # the entire path is inside of the `${ }` which ensures that the # derivation only consumes that directory. Writing `${./.}/.cargo` would # incorectly consume the entire source root, and therefore rebuild # everything when any file changes, which defeats artifact caching. # # Also note the `--no-target-directory` flag which ensures the results are # copied to `$out/.cargo` instead of something like `$out/HASH-.cargo` extraDummyScript = '' cp -r ${./.cargo} --no-target-directory $out/.cargo '';
}

